import './App.css';

function App() {
  // return <Home />;
  return (
    <HashRouter>
      <Route path="/" exact={true} component={Home}/>
      <h1>Home</h1>
      <Route path="/about" component={About}/>
      <h1>About</h1>
    </HashRouter>
  )
}


export default App;
